import React from "react";

import {
  SpinnerContainer,
  SpinnerOverlay,
} from "../with-spinner/with-spinner.componen";

const Spinner = () => {
  return (
    <SpinnerOverlay>
      <SpinnerContainer />
    </SpinnerOverlay>
  );
};

export default Spinner;
